reate the pie chart\n","ggplot(percentage_data, aes(x = \"\", y = Percentage, fill = UserType)) +\n","  geom_bar(stat = \"identity\", width = 1) +\n","  geom_text(aes(label = paste0(round(Percentage), \"%\")), position = position_stack(vjust = 0.5), size = 4) +\n","  coord_polar(\"y\", start = 0) +\n","  labs(title = \"Percentage of Members vs Casual Users\",\n","       fill = \"User Type\",\n","       x = NULL,\n","       y = NULL) +\n","  theme_void() +\n","  theme(legend.position = \"bottom\")\n"]},{"cell_type":"markdown","id":"4c8be28b","metadata":{"papermill":{"duration":0.017182,"end_time":"2024-04-09T14:56:17.07337","exception":false,"start_time":"2024-04-09T14:56:17.056188","status":"completed"},"tags":[]},"source":["<div style=\"background-color:#eaf7ea; padding: 20px;\">\n","    <p style=\"font-size:20px; font-family:Georgia, serif; line-height: 1.7em; color:#003366;\">\n","    \n","## The most used stations"]},{"cell_type":"code","execution_count":16,"id":"98626b67","metadata":{"execution":{"iopub.execute_input":"2024-04-09T14:56:17.110829Z","iopub.status.busy":"2024-04-09T14:56:17.109084Z","iopub.status.idle":"2024-04-09T14:56:19.392816Z","shell.execute_reply":"2024-04-09T14:56:19.39105Z"},"papermill":{"duration":2.305175,"end_time":"2024-04-09T14:56:19.395344","exception":false,"start_time":"2024-04-09T14:56:17.090169","status":"completed"},"tags":[]},"outputs":[],"source":["###  Show top 10 starting stations\n","\n","# Filter out \"Unknown\" station names\n","ridership_by_station <- yearly_data_v2 %>%\n","  filter(start_station_name != \"Unknown\") %>%\n","  group_by(start_station_name) %>%\n","  summarise(number_of_rides = n()) %>%\n","  arrange(desc(number_of_rides)) # Arrange in descending order of number_of_rides\n","\n","# Filter for top ten stations based on total number of rides\n","top_ten_stations <- ridership_by_station %>%\n","  top_n(10, number_of_rides) %>%\n","  pull(start_station_name)\n","\n","# Filter the original data for only the top