aring findings"]},{"cell_type":"markdown","id":"41b931fb","metadata":{"papermill":{"duration":0.026835,"end_time":"2024-04-09T14:56:36.720545","exception":false,"start_time":"2024-04-09T14:56:36.69371","status":"completed"},"tags":[]},"source":["<div style=\"background-color:#eaf7ea; padding: 20px;\">\n","    <p style=\"font-size:20px; font-family:Georgia, serif; line-height: 1.7em; color:#003366;\">\n","    \n","\n","## 5.1 The importance of visualizations\n","\n","The previous step of data analysis included visualizations that are used to simplify the results and make it easy to read through the analysis process. Bar plots of aggregated data give a quick and simplified view of trends and make a good way to share the findings with stakeholders.\n","\n","\n","## 5.2 Exporting summary for further visualizations\n","\n","### Export the main analysis dataframes\n","\n","Each part of trend analysis is exported into a csv file which can be used in an external visualization tool such as Tableau or PowerBI"]},{"cell_type":"code","execution_count":34,"id":"646ed9f2","metadata":{"execution":{"iopub.execute_input":"2024-04-09T14:56:36.778909Z","iopub.status.busy":"2024-04-09T14:56:36.77732Z","iopub.status.idle":"2024-04-09T14:56:36.822752Z","shell.execute_reply":"2024-04-09T14:56:36.820955Z"},"papermill":{"duration":0.077287,"end_time":"2024-04-09T14:56:36.825395","exception":false,"start_time":"2024-04-09T14:56:36.748108","status":"completed"},"tags":[]},"outputs":[],"source":["# Export ride_length_stats to CSV\n","write.csv(ride_length_stats, file = \"ride_length_stats.csv\", row.names = FALSE)\n","\n","# Export top_ten_stations to CSV\n","write.csv(top_ten_stations, file = \"top_ten_stations.csv\", row.names = FALSE)\n","\n","# Export percentage_data to CSV\n","write.csv(percentage_data, file = \"percentage_data.csv\", row.names = FALSE)\n","\n","# Export ridership_by_station_top_ten to CSV\n","write.csv(ridership_by_station_top_ten, file = \"ridership_by_station_top_ten.c